import { Component, OnInit } from '@angular/core';
import { EventService, Event } from '../services copy/event.service';
@Component({
  selector: 'app-view-event',
  templateUrl: './view-event.component.html',
  styleUrls: ['./view-event.component.css']
})
export class ViewEventComponent implements OnInit {
  events: Event[] = [];
  loading = true;
  errorMessage = '';

  constructor(private eventService: EventService) {}

  ngOnInit(): void {
    this.loadEvents();
  }

  loadEvents() {
    this.eventService.getEvents().subscribe({
      next: (data) => {
        this.events = data;
        this.loading = false;
      },
      error: (err) => {
        this.errorMessage = 'Failed to load events';
        this.loading = false;
        console.error('Error fetching events:', err);
      }
    });
  }
}
<div class="view-event-container">
  <h2>Events</h2>

  <div *ngIf="loading" class="loading">Loading events...</div>
  <div *ngIf="errorMessage" class="error">{{ errorMessage }}</div>

  <table *ngIf="!loading && events.length > 0" class="event-table">
    <thead>
      <tr>
        <th>ID</th>
        <th>Course Title</th>
        <th>Topic ID</th>
        <th>Location ID</th>
        <th>Speaker ID</th>
        <th>Class Size</th>
        <th>Number of Days</th>
        <th>Start Date</th>
        <th>End Date</th>
      </tr>
    </thead>
    <tbody>
      <tr *ngFor="let ev of events">
        <td>{{ ev.eventId }}</td>
        <td>{{ ev.courseTitle }}</td>
        <td>{{ ev.topicId }}</td>
        <td>{{ ev.locationId }}</td>
        <td>{{ ev.speakerId }}</td>
        <td>{{ ev.classSize }}</td>
        <td>{{ ev.numberOfDays }}</td>
        <td>{{ ev.startDate | date:'mediumDate' }}</td>
        <td>{{ ev.endDate | date:'mediumDate' }}</td>
      </tr>
    </tbody>
  </table>

  <div *ngIf="!loading && events.length === 0" class="no-data">
    No events found.
  </div>
</div>
